import React from "react";
import { BrowserRouter, Route, Routes, Navigate } from "react-router-dom";
import Home from './components/Home'

import Login from "./components/Login";

function PrivateRoute(isAuthenticated, children, ...rest) {
    return (
        <Route
          {...rest}
          render={({ location }) =>
          isAuthenticated ? (
              children
            ) : (
              <Navigate replace to={{
                  pathname: "/login/",
                  state: { from: location }
                }}
              />
            )
          }
          element={<Home {...props}/>}
        />
      );
}

function Urls(props) {

    return (
        <div>
            <BrowserRouter>
                <Routes>
                    <Route exact path="/login/" element={<Login {...props} />}/>
                    <PrivateRoute exact path="/" isAuthenticated={props.isAuthenticated}></PrivateRoute>
                </Routes>
            </BrowserRouter>
        </div>
    )
};

export default Urls;
